(ns y2023.day1
  (:require [clojure.string :as str]))

(defn ffilter [pred seq]
  (first (filter pred seq)))

(defn parse-ln [line]
  (let [line      (seq line)
        first-int (ffilter #(Character/isDigit %) line)
        last-int  (ffilter #(Character/isDigit %) (reverse line))]
    (Integer/parseInt (str first-int last-int))))

(defn parse-file [file]
  (reduce (fn [vals line]
            (conj vals (parse-ln line)))
    [] (str/split file #"\n")))

(defn sum-lines [file]
  (reduce + 0 (parse-file file)))

